import java.util.*;
public class Tablademultiplicar {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for(int i=1;i<=12;i++)
		{
			for(int m=0; m<=12;m++)
			{
			System.out.println(i+"*"+m+"="+m*m);	
			}
		System.out.println();
		}	
		
	}
}

